//twitter.com/japjaap",isExternal:!0,text:"Twitter",icon:"Twitter"},{href:"http://twitter.com/japjaap",isExternal:!0,text:"Youtube",icon:"YouTube"}]}}),content=(0,_immutable.fromJS)({html:[{tag:"p",attributes:{},children:[{text:"Jarenlang voeren Jacob Vlot en Jacob Kapitein met een viskotter op de Noordzee. Ze zagen dat meer gevangen vis werd vernietigd, omdat er geen bestemming voor werd gevonden. De markt deed niet altijd goed zijn werk. Om allerlei redenen ontstond er teveel aanbod en te weinig vraag, vertelt Cornelis Vlot, broer van Jacob en verantwoordelijk voor de marketing en communicatie van Voedselmarkt.nl. Ze onderzochten of dit in andere sectoren ook het geval was. Supermarkten die appels en peren afkeurden omdat ze te groot of te klein waren en telers die werden gedwongen ze voor een hele lage prijs te verkopen omdat er alleen nog appelmoes van gemaakt kon worden. Of complete partijen fruit verdwenen in de verbrandingsoven. We wilden iets verzinnen om dit voedsel alsnog in de markt te zetten. Als we vraag en aanbod bij elkaar konden brengen, was er zeker nog potentie, zegt Vlot."}]},{tag:"h2",attributes:{},children:[{text:"Traditioneel"}]},{tag:"p",attributes:{},children:[{text:"Jacob en Jacob schakelden een internetbureau in en begonnen een online bedrijf. We wilden van Voedselmarkt.nl een sectorbreed platform maken waar allerlei soorten voedsel werden aangeboden: aardappels, groenten en fruit, vis, vlees, maar ook zuivel. Ze zochten contact met zoveel mogelijk afnemers: restaurants, winkels, supermarkten, marktkooplui. Dat bleek best lastig om te verenigen op een platform: de gebruikers hadden verschillende motieven. Het was wel even zoeken naar een model dat voor iedereen werkte. Anderhalf jaar geleden ging er een basic website de lucht in waar bedrijven die interesse hadden zich konden melden. We wilden eerst eens kijken hoe erop werd gereageerd en op basis van de feedback verbeteringen aanbrengen. De vissector was voor de ondernemers het meest voor de hand liggend om te benaderen, zuivel was ingewikkelder, net als groenten en fruit. Sowieso is de voedselsector best traditioneel, handel via internet is nog voor lang niet iedereen gemeengoed. Wij willen buiten de gebaande wegen treden en zo de sector zo open mogelijk maken."}]},{tag:"h2",attributes:{},children:[{text:"Verliefd"}]},{tag:"p",attributes:{},children:[{text:"Al snel ontdekten ze manieren om bedrijven bij elkaar te brengen. We hadden een visrestaurant in ons netwerk en zij schenken ook wijn bij het eten. We brachten ze in contact met een groothandel die vaak restpartijen wijn had. Zo zorgen we voor verrassende matches. Particulieren kunnen niet terecht op Voedselmarkt, maar cateraars wel. Voor feesten en partijen zijn vaak op korte termijn grote partijen nodig. We zien veel verliefde paartjes ontstaan. 2016 wordt het jaar waarin het verdienmodel van Voedselmarkt vruchten moet gaan afwerpen. De laatste maanden is het aantal deelnemende bedrijven verdubbeld, en dat zal in 2016 nog een keer gebeuren verwachten we. De fee die Voedselmarkt.nl vraagt voor bemiddeling moet leiden tot een winstgevend bedrijf. De site zal in 2016 verder worden geprofessionaliseerd met tools waardoor er meer gestuurd kan worden op vraag. Plus de mogelijkheden om te onderhandelen worden verder verbeterd."}]},{tag:"h2",attributes:{},children:[{text:"Verbrandingsoven"}]},{tag:"p",attributes:{},children:[{text:"De ondernemers hebben Voedselmarkt met eigen geld gefinancierd, maar zoeken voor 2016 een investeerder. Ze hopen op iemand die niet alleen geld in Voedselmarkt steekt, maar hen ook kan helpen met kennis en een netwerk. Het geeft veel energie om te zien dat een paar duizend kilo voedsel niet wordt afgewaardeerd, maar dat de ondernemers erachter er een eerlijke prijs voor krijgen. Voedsel is met zorg geteeld, bewerkt en verpakt. Dat heeft grondstoffen, energie en menskracht gekost. Het doet pijn als dat niets opbrengt en eindigt in de verbrandingsoven. We hopen dit met Voedselmarkt te voorkomen."}]}]}),themaLinks=(0,_immutable.fromJS)({linkList:[{text:"Bedrijf starten",href:"/bedrijf-starten",hrefId:"tcm:106-123456",isExternal:!1},{text:"Internationaal ondernemen",href:"/internationaal-ondernemen",hrefId:"tcm:106-123457",isExternal:!1}]}),inspiration=(0,_immutable.fromJS)({html:[{tag:"h2",attributes:{},children:[{text:"Genspireerd geraakt?"}]},{tag:"p",attributes:{},children:[{text:"Lees de tips van de adviseurs van het Ondernemersplein"}]},{tag:"p",attributes:{},children:[{text:"Doe de ondernemerschapstest en ontdek of u klaar bent voor een eigen bedrijf."}]},{tag:"p",attributes:{},children:[{text:"Heb je recht op aftrekposten en hoeveel schrijf je af? Privauto of zakelijke auto? Zoek het uit in de aangiftehulp inkomstenbelasting van de Belastingdienst."}]}]}),relatedStories=(0,_immutable.fromJS)({title:"Gerelateerde verhalen",linkList:[{text:"Doe de dingen waar je zelf energie van krijgt",href:"/bouwvoorschriften",hrefId:"106-123456",isExternal:!1,image:{src:"http://placehold.it/437x228",alt:"Krijn Ratsma van Energieke Regio"}},{text:"Doe de dingen 2",href:"/bouwvoorschriften",hrefId:"106-123456",isExternal:!1,image:{src:"http://placehold.it/437x228",alt:"Krijn Ratsma van Energieke Regio"}},{text:"Doe de dingen 3",href:"/bouwvoorschriften",hrefId:"106-123456",isExternal:!1,image:{src:"http://placehold.it/437x228",alt:"Krijn Ratsma van Energieke Regio"}}]});(0,_react3.storiesOf)("Pages",module).addWithStore("Verhaal",function(){return _react2.default.createElement(_verhaal2.default,{title:"We willen de voedselsector openbreken",showCaseMedia:showCaseMedia,content:content,themaLinks:themaLinks,inspiration:inspiration,relatedStories:relatedStories})})}).call(exports,__webpack_require__(8)(module))},function(module,exports,__webpack_require__){"use strict";(function(module){var _react2=_interopRequireDefault(__webpack_require__(0)),_react3=__webpack_require__(9),_immutable=__webpack_require__(2),_webinar2=_interopRequireDefault(__webpack_r